import React from "react";
import "./CheckList.css";

export const CheckList = () => {
  const db = [
    { content: "content1", id: "1", checked: false },
    { content: "content2", id: "2", checked: false },
    { content: "content3", id: "3", checked: false },
  ];

  return (
    <div className="TDLContainer">
      <div className="TDLTitle">To dos</div>
      {db.map((value) => (
        <div key={value.id} className="TDLContentBox">
          <input type="checkBox" checked={value.checked}></input>
          <div>{value.content}</div>
        </div>
      ))}
      <div className="TDLInputBox">
        <input className="TDLAddInput" placeholder="입력하세요..."/>
        <button className="TDLAddButton">Add</button>
      </div>
    </div>
  );
};
